import React from "react";
import "../styles/login.css";

export default function Login() {
  return (
      <div class="container-fluid">
        <div class="header">
          <div class="wrap">
              <a href="https://www.sitehawk.com/" target="_blank">
                <img src="../images/Sphera RO.png" className="logo" alt="Sphera logo"></img>
              </a>
          </div>
        </div>
      </div>
  );
}
